import React from 'react';
import ReactDOM from 'react-dom';
import './Contributors.css';

function addNewlines(str) {
    var result = '';
    while (str.length > 0) {
      result += str.substring(0, 200) + '\n';
      str = str.substring(200);
    }
    return result;
  }

  
  function printContributors(object){
    for (let [key, value] of  object.entries()) {
        <div className="Contributor-Name">
        <p>
        <script>
        {document.write(key)}
        {document.write("\n")}
        </script>
        </p>
        </div>
    }
  }


function Contributors() {

    let map = new Map();
    map.set("Contributor 1", "I am a cat");
    map.set("Contributor 2", "I am a dog");
    map.set("Contributor 3", "I am a cow");

    return (
        <div className="App">
            <header className="App-header">
                <p>
                    Contributors
                </p>
            </header>
            
            {window.onload=printContributors(map)};
            
        </div>
    );
}



export default Contributors;

